/*
Tests about the loadgeojson feature.
*/
var tape = require('tape');
var lodash = require('lodash');
import Loadgeojson from '../../src/features/loadgeojson.js';

/*
sut must have message's 'command' valued as 'loadgeojson'.
*/
tape('handler must provide a "command" property valued as "loadgeojson".', function(assert) {
  var sut = new Loadgeojson;
  assert.equal("loadgeojson", sut.command, 'Handler\'s "command" property should be valued "loadgeojson".');
  assert.end();
});

/*
sut does nothing when message's 'payload' is undefined.
*/
tape('handler does returns unchanged state when message\'s "payload" property is undefined.', function(assert) {
  var message = {};
  var state = { say: "hello" };
  var sut = new Loadgeojson;
  assert.equal(state, sut.behave(message, state), 'When message has no \'payload\', handler returns state unchanged.');
  assert.end();
});

/*
when message's payload is solid, sut sets that value as state's 'serviceMap' property.
*/
tape('when message\'s payload is not \'undefined\' handler updates state\'s "customerMap" property with message\'s "payload".', function(assert) {
  var message = { payload: {} };
  var state = { say: "hello" };
  var sut = new Loadgeojson;
  assert.ok(lodash.isEqual({ say: "hello", customerMap: {} }, sut.behave(message, state)), 'Handler updates state\'s "customerMap" value with message\'s "payload".');
  assert.end();
});

