      ctrlz.queue.forEach(event => {
        ctrlzState = eventbus.accept(event, ctrlzState);
      });
      return ctrlzState;
    }
  });

  function removeLastHowmanyEvents(queue, howmany) {
    queue.splice(queue.length - howmany, queue.length - 1);
