  var eventsHandler = {
    accept: function(evt, state) {
      var newstate = eventbus.accept(evt, state);
      ctrlz.accept(evt, state);
      return newstate;
    }
  };
  eventsHandler.eventbus = eventbus;
  eventsHandler.ctrlz = ctrlz;
  return eventsHandler;
}

